import { Sound } from './Sound';

export function SoundChoser({Props}) {

  let songList=[];
  Props.forEach((Song,index)=>{
  songList.push(<Sound key = {Song.id} Path = {Song.url} Name = {Song.name}/>)
})
    return (
    <div>
    {songList}   
    </div>
    );
}
